def getmap(data):
    # ユーザーごとのリストを初期化
    users = []

    # data =[[0, 200, 0, 2.0, 3.0, 0.0, 0, 1.0], [1, 100, 0, 3.0, 5.0, 0.0, 0, 1.0]]
    # ジョブID,ユーザID，ジョブ待ち時間，ジョブの長さ，ジョブの必要ノード数，生成時間，クラウドを利用したかどうか，クラウド利用可能かどうか

    # データをイテレートして、適切なユーザーリストに追加
    for column in data:
        users.append([column[2]+column[5],column[3],column[1],column[4],column[6]])
    # 実行開始時間，長さ，ユーザID,実行終了時間,width,cloud

    map = np.zeros((100,12))
    map[:] = -2

    # print("a")

    for job in users:
        # print('job'+str(job))
        for long in range(int(job[1])):
            for yoko in range(12):
                # print(int(map[int(job[0])+long,yoko]))
                if int(map[int(job[0])+long,yoko]) == -2:
                    for width in range(int(job[3])):
                        map[int(job[0])+long,yoko+width]=int(job[2])
                    break


                else:
                    # print("already")
                    yoko += 1
                # print(map[:7]) 
            # print(map[:7])
    return map

